import { Button } from 'bootstrap';
import React from 'react'

// styles
import "./header.styles.scss";

const Header = () => (
    <>
        <div className="row no-gutters header-row">
            <div className="header-top col-lg-12">For all the car lovers out there!</div>
        </div>
        <div className="row">
            <div className="col-lg-4"><Button>Accessories store</Button> <Button>Premium services</Button></div>
            <div className="col-lg-4">column 2</div>
            <div className="col-lg-4">column 3</div>
        </div>
    </>
);

export default Header;
